import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Login from './components/Login';
import Register from './components/Register';
import UploadResume from './components/UploadResume';
import ReviewResumes from './components/ReviewResumes';
import ProtectedRoute from './components/ProtectedRoute';
import ViewReviews from './components/ViewReviews';
const App = () => {
    return (
        <Router>
            <Switch>
                <Route path="/login" component={Login} />
                <Route path="/register" component={Register} />
                <ProtectedRoute path="/upload" component={UploadResume} />
                <ProtectedRoute path="/reviews" component={ReviewResumes} />
                <ProtectedRoute path="/my-reviews" component={ViewReviews} />
                {/* Add more routes as needed */}
            </Switch>
        </Router>
    );
};

export default App;
